import logo from './logo.svg';
import './App.css';
import {useState} from 'react';
import { Route, Routes, Link } from 'react-router-dom';
import Home from './Home';
import About from './About';

function App() {
  return (
    <>
      <Link> Home </Link>
      <Link> About </Link>
      <Routes>
        <Route path='Home' element={<Home/>}/>
        <Route path='About' element={<About/>}/>
      </Routes>
    </>
  );
}


export default App;
